import React from 'react';
import { Link } from 'react-router-dom';

function User(props) {
  if (!props.user) return null; // Prevent error if user is undefined

  const { _id, name, age, address } = props.user;

  return (
    <div>
      <h1>User display</h1>
      <br />
      <h1>id: {_id}</h1>
      <h1>Name: {name}</h1>
      <h1>Age: {age}</h1>
      <h1>Address: {address}</h1>
      <Link to={`/UserDetails/${_id}`}>
        <button>View Details</button>
      </Link>
      
      <button>Delete </button>
    </div>
  );

  
}
export default User;
